/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-timeline-root"><ul class="ui5-timeline-list" role="listbox" aria-live="polite" aria-label="${ifDefined(context.ariaLabel)}">		${ repeat(context.items, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</ul></div>`; };
const block1 = (item, index, context) => { return html`<li class="ui5-timeline-list-item"><slot name="${ifDefined(item._individualSlot)}"></slot></li>		`; };

export default block0;
